import logo from '../logo.svg';
import Banner from './Banner';

function App() {
  return (
    <div className="App">
      <Banner>
        <img
          src="{logo}"
          className="jh-logo"
        />
        <h1 classeName="jh-title">Jungle house</h1>        
      </Banner>
    </div>
  );
}

export default App;
